class TireTree {
private:
	struct node {
		int posi;
		string x,y;
		int num;
		node *brother;
		node *child;
		node(string x, string y):x(x),y(y),posi(-1), brother(NULL),child(NULL),num(0){}
		node(int p):posi(p), brother(NULL),child(NULL),num(0){}
	};
	bool match(string ax, string bx, string ay, string by) {
		int axx = ax[0]-'A', bxx = bx[0]-'A';
		int byy = atoi(by.c_str()), ayy = atoi(ay.c_str());
		return abs(axx-bxx) <= 1 && abs(ayy-byy) <= 1;
	}
	int convertPosi(string );
	void remove(node *);
	// bool isEqual();
	node *root;
public:
	int state;
	TireTree() {
		root = new node(-1);
		state = -1;
	}
	int size() {
		return root->num;
	}
	~TireTree() {
		remove(root);
	}
	void load();
	void insert(string &seq);
	int findBest(string &seq/*, double* bonus*/);
	void updateSeq(string &seq, unipolar::PositionIndex pos);
	// void normalize();
};

void TireTree::remove(node *n) {
	if (n == NULL)
		return;
	remove(n->child);
	remove(n->brother);
	delete n;
	return;
}

void TireTree::updateSeq(string &seq, unipolar::PositionIndex pos) {
	int x = pos / unipolar::BOARD_SIZE;
	int y = pos % unipolar::BOARD_SIZE + 1;
	char x_char = (x > 7 ? x + 1 : x) + 'A';
	char tmp_str[50000], color;
	color = (color == 'b') ? 'w' : 'b';
	snprintf(tmp_str, sizeof(tmp_str), "%s %c %d", seq.c_str(), x_char, y);
	seq = (string)tmp_str;
	// printf("joseki\n");
}

void TireTree::insert(string &seq) {
	state = 1;
	string x, y;
	int len = seq.length(), idx = 0;
	int num = 0;
	node *tmpC = NULL, *tmp = root, *tmpB = NULL;
	stringstream mid_seq(seq);
	mid_seq >> num;
	root->num += num;
	while ((tmpC = tmp->child) && mid_seq >> x >> y) {
		if (tmpC->x == x && tmpC->y == y ) {
			tmp = tmpC;
			tmp->num += num;
			continue;
		} else {
			tmpB = tmpC->brother;
			while (tmpB) {
				tmpC = tmpB;
				if (tmpB->x == x && tmpB->y == y) {
					tmpB->num += num;
					break;
				}
				tmpB = tmpB->brother;
			}
			if (tmpB) {tmp = tmpB; continue;}
			tmpC->brother = new node(x, y);
			tmpC->brother->num = num;
			tmpC = tmpC->brother;
			while (mid_seq >> x >> y) {
				tmpC->child = new node(x, y);
				tmpC->child->num = num;
				tmpC = tmpC->child;
			}

		}
	}
	while (mid_seq >> x >> y) {
		tmp->child = new node(x, y);
		tmp = tmp->child;
		tmp->num = num;
	}
}

int TireTree::findBest(string &pattern/*, double* bonus*/) {
	stringstream mid_seq(pattern);
	string x, y;
	node *tmp = root->child, *tmpp = root, *parent = root;
	// allow one step error, and record that error stone.
	bool tolerate = true;
	node *actual = NULL;
	// for(int i = 0; i < unipolar::BoardSizeSquare(unipolar::BOARD_SIZE); ++i)
	// 	bonus[i] = 0;

	while(tmp && mid_seq >> x >> y) {
		if(x == "N" && y == "13") {
			tmp = NULL;
			break;
		}
		if(!tolerate && actual->x == x && actual->y == y) {
			tmp = NULL;
			break;
		}
	    if (tmp->x == x && tmp->y == y /*|| match(tmp->x, x, tmp->y, y)*/) {
	    	parent = tmpp = tmp;
	    	tmp = tmp->child;
	    	continue;
	    } else {
	    	tmpp = tmp;
	    	tmp = tmp->brother;
	    	while (tmp) {
	    		if (tmp->x == x && tmp->y == y/* || match(tmp->x, x, tmp->y, y)*/) {
	    			parent = tmpp = tmp;
	    			tmp = tmp->child;
	    			break;
	    		} else {
	    			tmpp = tmp;
	    			tmp = tmp->brother;
	    		}
	    	}
	    }
	    if(!tmp && tolerate) {
	    	tolerate = false;
	    	tmp = parent->child;
	    	while(tmp) {
		    	if(match(tmp->x, x, tmp->y, y)) {
		    		parent = tmpp = tmp;
		    		tmp = tmp->child;
		    		break;
		    	} else {
		    		tmpp = tmp;
		    		tmp = tmp->brother;
		    	}
	    	}
	    	actual = new node(x, y);
	    }
	}
	int MAX = -1, total = 0;
	node *max_node = NULL;
	while(tmp) {
	    if (tmp->num > MAX){
	    	MAX = tmp->num;
	    	max_node = tmp;
	    }
		char x_char = tmp->x[0];
		int x = (x_char > 'I' ? x_char - 1 : x_char) - 'A';
		int y = y = atoi(tmp->y.c_str()) - 1;
		// cout << tmp->num << ' ' << total << endl;
		total += tmp->num;
		// bonus[x*13+y] = tmp->num;
    	tmp = tmp->brother;
	}

	// cout << total << endl;
	// for(int i = 0; i < unipolar::BoardSizeSquare(unipolar::BOARD_SIZE); ++i) {
	// 	if(bonus[i] < 1e-6)
	// 		bonus[i] = 0;
	// 	else 
	// 		bonus[i] /= total;
	// 	// limit the number.
	// 	if(bonus[i] < 1e-4)
	// 		bonus[i] = 0;
	// }	
	if(!max_node)
		return unipolar::POSITION_PASS;
	else {
		char x_char = max_node->x[0];
		int x = (x_char > 'I' ? x_char - 1 : x_char) - 'A';
		int y = y = atoi(max_node->y.c_str()) - 1;
		//cout << "best move: " << x_char << ' ' << y+1 << endl;
		return x*13+y;
	}
}

